import React from "react";
import { connect } from "react-redux";
const MyCart = ({list}) =>{
    return(
        <div>
            <ul>
                {list.length >0?
                    <li className="book">
                        <div className="card">
                            <img src={list.image} alt={list.image}/>
                        </div>    
                    </li>
                :"No Data in cart"}
            </ul>
        </div>
    )
}

const mapStateToProps = state =>({
    list:state.cartreducer
    
})
export default connect(mapStateToProps)(MyCart);
